      des effluves de bi\xE8re."}
- model: socialnetwork.bar
  pk: 9
  fields: {name: L'Okapi, address: '15 Rue des Deux Haies, Centre-ville Angers 49100',
    localisation: 49, picture: upload/l-okapi-angers-147030588652.jpeg, speciality: Shot,
    prix: 3, description: "Lorsqu\u2019on va \xE0 l\u2019Okapi, l\u2019ap\xE9ro est
