- model: socialnetwork.bar
  pk: 10
  fields: {name: "F\xE9es Maison", address: "3 rue Pr\xE9 Nian, 44000 Nantes", localisation: 44,
    picture: upload/fee.jpeg, speciality: Vin, prix: 5, description: "Le F\xE9es Maison
