      vous accueillent dans une ambiance chaleureuse. Ouvert il y'a peu , l'\xE9tablissement
      est un vrai f\xE9e-nom\xE8ne nantais : plut\xF4t salon de th\xE9 , petit bar
      tranquille en d\xE9but de soir\xE9e et en semaine , le weekend l'\xE9tablissement
      (gay friendly) se transforme en n'importe quoi extr\xEAmement chaleureux :que
      se soit pour un Karaok\xE9 improvis\xE9, une partie de jeu ou une danse endiabl\xE9e
      vous \xEAtes certains de vous amuser. Le concept propos\xE9 f\xE9e-d\xE8re un
      grand nombre de personnes (essentiellement des habitu\xE9s certes) mais les
      gens n'h\xE9sitent pas \xE0 se parler , se m\xE9langer , bref tout le monde
      \xE0 un tr\xE8s bon esprit, que l'on pourrait qualifier de f\xE9e-stif."}
- model: socialnetwork.bar
